import React from 'react';
import logo from './logo.svg';
import './App.css';

class App extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            ruleNames: []
        }
    }

    componentDidMount() {
        fetch("http://localhost:9000/kings")
            .then(res => res.json())
            .then((data) => {
                this.setState({ruleNames: data});
            })
            .catch(console.log)
    }

    componentWillUnmount() {
    }

    render() {
        let items = this.state.ruleNames.map(
            (x, i) => {
                return <li> {x} </li>
            });
        let list = <ul>{items}</ul>;
        // Array.prototype.map()
        return (
            <div className="App">
                {list}
                <ul>{"titties"}</ul>
            </div>
        );
    }
}

export default App;
